  width: 33%;
  height: 100%;
  display: flex;
  flex-direction: column;
  justify-content: space-around;
`;

const Btn = styled.button`
  border-radius: ;
`

const SelectLeft = () => {
  return (
    <Div>
      <Button name={"새로나온 예고편"} />
      <Button name={"최신 개봉작"} />
      <Button name={"상영 까지 1주일"} />
      <Button name={"OTT"} />
    </Div>
  );
};

export default SelectLeft;
